import React, { Component } from 'react'

class CountryDetails extends Component {
    render() {
        const { capital, area, borders } = this.prop.match.params
        return (
            <>
                <p>{capital}</p>
                <p>{area}</p>
                <p>{borders}</p>
            </>
        )
    }
}

export default CountryDetails
